      {/* <Pokemon/> */}
      <div style={{width:"25vw", height:"50vh", backgroundColor:"gray"}}>
        <div style={{border:"1px solid red"}}>Title</div>
        <div style={{width:"200px", height:"200px", backgroundColor:"black"}}>Title</div>
      </div>
    </div>
  );
}

export default App;
